values:
Wow!
Okay so i cannot wait for finals to be over with.&nbsp;I'm coming home thursdayyyyy. and&nbsp;trust me, thursday&nbsp;cannot come&nbsp;quick enough.
So today i&nbsp;had the worst final ever. History-making&nbsp;of the modern&nbsp;(gay) world. Its the worst class ever.... don't take it. you'll kill yourself. especially if you have a foreign&nbsp;professor.
Anyways, i did really well on my piano final on monday. which was a relief...&nbsp;he said i should get between an A or an A- in the class. no complaints there.
My business final tomorrow is going to absolutely suckkkkk. 100 multiple choice, 2 essays. errrr.&nbsp;
oh well, four more finals to goooo.....
My roommate is moving out tomorrow, :( , and my new&nbsp;roommate alyssaaaaaa is moving in tomorrow/thursday :D
I'm so excited, but things are going to&nbsp;be so hectic around here.&nbsp;my two quadmates are moving&nbsp;across teh hall, and one of the girls&nbsp;from that quad is moving into my quad, and nicole from downt he hall is moving in too. Its going to CRAZY.&nbsp;
Oh well,&nbsp;i want it to be thursday like now!!&nbsp;
